import './App.css';
import Nav from './Nav';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
     Test
     <BrowserRouter>
     <Nav />
     <Routes>
       <Route path="/" element={<h1>User List</h1>} />
     </Routes>
     </BrowserRouter>
    </div>
  );
}

export default App;
